import React, { useEffect, useState } from "react";

import Calendar from "./components/Calendar/index";

const App = () => {
  useEffect(() => {
    getAllEvents();
  });

  const getAllEvents = () => {
    fetch("/api/v.1.0/events", { mode: "no-cors" })
      .then(function(response) {
        if (!response.ok) {
          console.log("Something is wrong");
          return;
        }
        return response.json();
      })
      .then(data => {
        if (!data) {
          return;
        }

        setEvents(data);
      });
  };

  return <Calendar />;
};

export default App;
